import React from 'react'
import { View, TouchableOpacity, StyleSheet, ScrollView, Button } from 'react-native'
import { useDispatch, useSelector } from 'react-redux'
import { resetState } from '../redux/QuestionsReducer';




const Setting = ({ navigation }) => {

  return (
    <View style={styles.container}>

      {/* View 1 */}
      <View style={styles.view1}>
        {/* Nội dung của View 1 */}
      </View>

      {/* View 2 */}
      <View style={styles.view2}>
        {/* Nội dung của View 2 */}
      </View>
    </View>

  )
}

export default Setting

const styles = StyleSheet.create({
  container: {
    flex: 1, // Đảm bảo để View cha chiếm toàn bộ không gian
  },
  view1: {
    position: 'absolute', // Đặt vị trí tuyệt đối
    top: 0, // Đặt top là 0 để đè lên View cha
    left: 0, // Đặt left là 0 để đè lên View cha
    width: '100%', // Chiều rộng 100%
    height: '100%', // Chiều cao 100%
    backgroundColor: 'rgba(255, 0, 0, 0.5)', // Màu nền và độ trong suốt
  },
  view2: {
    position: 'absolute',
    top: 20, // Ví dụ: Top và left để điều chỉnh vị trí View 2
    left: 20,
    width: '80%', // Chiều rộng 80%
    height: '80%', // Chiều cao 80%
    backgroundColor: 'rgba(0, 0, 255, 0.5)',
  },
});
